import React from 'react';
import Sidebar from './Components/Sidebar';
import TopBar from './Components/TopBar';
import DashboardOverview from './Components/DashboardOverview';
import './App.css';
function App() {
  return (
    <div className="app">
      <Sidebar />
      <div className="main-content">
        <TopBar />
        <DashboardOverview />
      </div>
    </div>
  );
}

export default App;
